import { BrowserRouter as Router, Switch, Route, NavLink  } from "react-router-dom";
import Button from '@mui/material/Button';
import { AuthContextProvider, AuthContext  } from '../contexts/AuthContext';
import { useContext } from "react";
import {useHistory} from 'react-router-dom';
import axios from "axios"
import { API } from "../api"
import styled from "styled-components"

const styles = {
  "&.MuiButton-root": {
    border: "2px black solid"
  },
  "&.MuiButton-text": {
    color: "black",
    border: "1px white solid",

  },
  "&.MuiButton-contained": {
    color: "yellow"
  },
  "&.MuiButton-outlined": {
    color: "brown"
  }
};


function Navbar() {

    const { user ,logout } = useContext(AuthContext)
    const history = useHistory();


    function handleSubmit() {
        axios.post(API.auth.logout)
        .then(res => {
          history.push(`/countries/login`)
          logout()

        })
        return () => null
    }
    return (



        <Topwrapper> 
          <Logo>Mapwith</Logo>
          {user ?(
          <>
          <Button  variant="text"   onClick={handleSubmit}>Logout</Button>
          <Button sx={styles} variant="text"   onClick = {() => history.push(`/create-countries`)}>Create Country List!!</Button>
          </>
          ):(
          <Icon>
            <Linkedin>
              <NavLink to={`/countries/login`}>
              Login
              </NavLink>
            </Linkedin>

            <Airbnb>
              <NavLink to={`/countries/signup`}>
              SignUp
              </NavLink>
            </Airbnb>
          </Icon>
          )}
        </Topwrapper> 


    );
}

export default Navbar


const Topwrapper = styled.div`
display: flex;
position: relative;
margin-left: auto;
margin-right: auto;
padding: 21px 16px;
right: 120px;
left: 120px;
`


const Logo= styled.div`

flex-grow: 1;
flex-shrink: 1;
flex-basis: 0%;
`

const Icon= styled.div`
margin-right: 64px;
display: flex;

`

const Linkedin= styled.div`
margin-right: 12px;


`

const Airbnb= styled.div`
margin-right: 12px;


`
